// Get the input text from the 'query' field of the first item
const inputText = items[0].json.query;

// Regex to match patterns like: Name (Location) - `URL`
const regex = /(.*?)\s*\((.*?)\)\s*-\s*`(https?:\/\/[^\s`]+)`/g;

let match;
const results = [];

// Loop through all matches found in the input text
while ((match = regex.exec(inputText)) !== null) {
  if (match[1] && match[2] && match[3]) {
    results.push({
      name: match[1].trim(),
      location: match[2].trim(),
      url: match[3].trim(),
    });
  }
}

// Return the structured JSON
return [{ json: { query: results } }];
